import React, { Component } from 'react';
import { slide as sideMenu } from 'react-burger-menu';
import { StyledDrawerWrapper } from 'components/app/styleDrawerWrapper';

export class NotificationDrawer extends Component {

    render(){
        return (
            <StyledDrawerWrapper>
                <sideMenu
                    right
                    width={25}
                    noOverlay
                    isOpen={true}

                >
                Notification Window Thing
                </sideMenu>
            </StyledDrawerWrapper>
        );
    }
}
